import React from "react";
import lupa from "../../img/lupa.svg"

function Search(){
    return(
        <div className="search-form">
            <form className="search-form__forma">
                <img className="lupa" alt="поиск" src={lupa}/>
            </form>
        </div>
    );
};
export default Search;
